  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0117715 includes Surface
  underway, biological, chemical, meteorological and physical data collected from
  NOAA Ship MALCOLM BALDRIGE in the Banda Sea, Celebes Sea, Indian Ocean, Java Sea,
  Molucca Sea, North Pacific Ocean, South China Sea (Nan Hai) and South Pacific Ocean
  from 1994-04-16 to 1994-09-25 and retrieved during cruise DIC94, EQPAC_F94 and EQPAC_S94.
  These data include BAROMETRIC PRESSURE, CHLOROPHYLL, CHLOROPHYLL A, DISSOLVED INORGANIC
  CARBON (DIC), DISSOLVED OXYGEN, NITRATE + NITRITE CONTENT (CONCENTRATION), NITRITE,
  OXYGEN - APPARENT UTILIZATION (AOU), PHAEOPHYTIN, PHOSPHATE, Partial pressure (or
  fugacity) of carbon dioxide - atmosphere, Partial pressure (or fugacity) of carbon
  dioxide - water, SALINITY, SEA SURFACE TEMPERATURE, SILICATE and WATER TEMPERATURE.
  The instruments used to collect these data include Carbon dioxide (CO2) gas analyzer
  and Shower head chamber equilibrator for autonomous carbon dioxide (CO2) measurement.
  These data were collected by Rik Wanninkhof of US DOC; NOAA; OAR; Atlantic Oceanographic
  and Meteorological Laboratory as part of the DIC94, EQPAC_F94 and EQPAC_S94 data
  set.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
